"ref":"hikari.MessageBulkDeleteEvent",
"url":0,
"doc":"Event triggered when messages are bulk-deleted from a channel.  ! note There is only a guild equivalent of this event at the time of writing. However, Discord appear to not be ruling out that this ability may be implemented for private channels in the future. Thus, this base exists for future compatibility and consistency. If you care about the event occurring in a guild specifically, you should use the  GuildMessageBulkDeleteEvent . Otherwise, using this event base is acceptable. See https: github.com/discord/discord-api-docs/issues/1633 for Discord's response. This requires one of the following combinations of intents in order to be dispatched: -  hikari.intents.Intents.GUILD_MESSAGES Method generated by attrs for class MessageBulkDeleteEvent."
