"doc":"The base for a HTTP-only Discord application. This comprises of a shared TCP connector connection pool, and can have  RESTClientImpl instances for specific credentials acquired from it. Parameters      connector_factory : typing.Optional[ConnectorFactory] A factory that produces an  aiohttp.BaseConnector when requested. Defaults to a connector for a shared  aiohttp.TCPConnector if  builtins.None . The connector factory is expected to handle providing locks around resources and caching any result as desired. connector_owner : builtins.bool If you created the connector yourself, set this to  builtins.True if you want this component to destroy the connector once closed. Otherwise,  builtins.False will prevent this and you will have to do this manually. The latter is useful if you wish to maintain a shared connection pool across your application with other non-Hikari components.  ! warning If you do not give a  connector_factory , this will be IGNORED and always be treated as  builtins.True internally. executor : typing.Optional[concurrent.futures.Executor] The executor to use for blocking file IO operations. If  builtins.None is passed, then the default  concurrent.futures.ThreadPoolExecutor for the  asyncio.AbstractEventLoop will be used instead. http_settings : typing.Optional[hikari.config.HTTPSettings] HTTP settings to use. Sane defaults are used if this is  builtins.None . proxy_settings : typing.Optional[hikari.config.ProxySettings] Proxy settings to use. If  builtins.None then no proxy configuration will be used. url : typing.Optional[builtins.str] The base URL for the API. You can generally leave this as being  builtins.None and the correct default API base URL will be generated.  ! note This event loop will be bound to a connector when the first call to  acquire is made."
