"ref":"hikari.messages.MessageFlag",
"url":21,
"doc":"Additional flags for message options. This flag type has several additional operations that can be used compared to normal enum types. These are applied to instances of this enum directly, or can be used as a class method by passing the flag as the first parameter. -  def split() -> typing.Sequence[MessageFlag]:  .  Will split the combined flag up into individual atomic flags and return them in a  typing.Sequence .   >>> (FOO | BAR | BAZ).split() [FOO, BAR, BAZ]   -  def has_any( flags: MessageFlag) -> bool:  .  Returns  builtins.True if any of the given flags are present in the combined flag this is applied to. Otherwise, returns  builtins.False instead. -  def has_all( flags: MessageFlag) -> bool:  .  Returns  builtins.True if all of the given flags are present in the combined flag this is applied to. Otherwise, returns  builtins.False instead. -  def has_none( flags: MessageFlag) -> bool:  .  Returns  builtins.True if none of the given flags are present in the combined flag this is applied to. Otherwise, returns  builtins.False instead. In addition, new operators are overloaded.  + will combine flags in the same way  | would usually, and  - will remove specific flags from this instance. This is equivalent to using the  & operator. Finally, combined flag types can be iterated across as if they were a collection.   >>> for f in FOO | BAR | BAZ:  . print(f) FOO BAR BAZ  "
