"doc":"Request for a guild chunk.  ! note For the chunker to track a request the request may need to be made using this method rather than using  hikari.api.shard.GatewayShard.request_guild_members . Parameters      guild : hikari.guilds.Guild The guild to request chunk for. include_presences : hikari.undefined.UndefinedOr[builtins.bool] If specified, whether to request presences. query : builtins.str If not    , request the members which username starts with the string. limit : builtins.int Maximum number of members to send matching the query. users : hikari.undefined.UndefinedOr[typing.Sequence[hikari.snowflakes.SnowflakeishOr[hikari.users.User ] If specified, the users to request for.  ! note To request the full list of members, set  query to    (empty string) and  limit to  0 . Returns    - builtins.str The generated unique nonce used for tracking this request. Raises    ValueError When trying to specify  users with  query / limit , if  limit is not between 0 and 100, both inclusive or if  users length is over 100. hikari.errors.MissingIntentError When trying to request presences without the  GUILD_MEMBERS or when trying to request the full list of members without  GUILD_PRESENCES .",
