"doc":"Create webhook in a channel. Parameters      channel : hikari.snowflakes.SnowflakeishOr[hikari.channels.TextChannel] The channel where the webhook will be created. This may be a  hikari.channels.TextChannel or the ID of an existing channel. name : str The name for the webhook. This cannnot be  clyde . avatar : typing.Optional[hikari.files.Resourceish] If specified, the avatar for the webhook. reason : hikari.undefined.UndefinedOr[builtins.str] If provided, the reason that will be recorded in the audit logs. Returns    - hikari.webhooks.Webhook The created webhook. Raises    hikari.errors.BadRequestError If  name doesnt follow the restrictions enforced by discord. hikari.errors.ForbiddenError If you are missing the  MANAGE_WEBHOOKS permission. hikari.errors.UnauthorizedError If you are unauthorized to make the request (invalid/missing token). hikari.errors.NotFoundError If the channel is not found. hikari.errors.InternalServerError If an internal error occurs on Discord while handling the request.",
