"doc":"Request for a guild chunk. Parameters      guild : hikari.guilds.Guild The guild to request chunk for. timeout : typing.Union[builtins.int, builtins.float, builtins.None] The maximum amount of time the returned stream should spend waiting for the next chunk event to be received before ending the iteration. If  builtins.None then this will never timeout between events. limit : typing.Optional[builtins.int] The limit for how many events the streamer should queue before dropping extra received events. Leave as  builtins.None for this to be unlimited. include_presences : hikari.undefined.UndefinedOr[builtins.bool] If specified, whether to request presences. query : builtins.str If not    , request the members which username starts with the string. query_limit : builtins.int Maximum number of members to send matching the query. users : hikari.undefined.UndefinedOr[typing.Sequence[hikari.snowflakes.SnowflakeishOr[hikari.users.User ] If specified, the users to request for.  ! note To request the full list of members, set  query to    (empty string) and  limit to  0 .  ! note The chunk request will not be sent off until the returned stream is opened.  ! warning Validation errors like  builtins.ValueError and  hikari.errors.MissingIntentError will be delayed until you open the returned stream. Returns    - hikari.utilities.event_stream.Streamer[hikari.events.shard_events.MemberChunkEvent] A stream of chunk events for the generated request.",
