"doc":"Edit this webhook. Parameters      name : hikari.undefined.UndefinedOr[builtins.str] If specified, the new name string. avatar : hikari.undefined.UndefinedOr[hikari.files.Resourceish] If specified, the new avatar image. If  builtins.None , then it is removed. If not specified, nothing is changed. channel : hikari.undefined.UndefinedOr[hikari.snowflakes.SnowflakeishOr[hikari.channels.TextChannel If specified, the object or ID of the new channel the given webhook should be moved to. reason : hikari.undefined.UndefinedOr[builtins.str] If specified, the audit log reason explaining why the operation was performed. This field will be used when using the webhook's token rather than bot authorization. use_token : hikari.undefined.UndefinedOr[builtins.bool] If set to  builtins.True then the webhook's token will be used for this request; if set to  builtins.False then bot authorization will be used; if not specified then the webhook's token will be used for the request if it's set else bot authorization. Returns    - hikari.webhooks.Webhook The updated webhook object. Raises    hikari.errors.BadRequestError If any invalid snowflake IDs are passed; a snowflake may be invalid due to it being outside of the range of a 64 bit integer. hikari.errors.NotFoundError If either the webhook or the channel are not found. hikari.errors.ForbiddenError If you either lack the  MANAGE_WEBHOOKS permission or are not a member of the guild this webhook belongs to. hikari.errors.UnauthorizedError If you pass a token that's invalid for the target webhook. builtins.ValueError If  use_token is passed as  builtins.True when  Webhook.token is  builtins.None .",
